import React from 'react';
import ReactDOM from 'react-dom';
import './buy.css';

export default function Buy() {
    return (
        <div>
            <button className="button-spot-index">Buy from SPOT</button>
            <button className="button-fiat-index">Buy from FIAT</button>

            
        </div>
    );
}
